func Benchmark_plainSitemapPageIterator(b *testing.B) {
	for i := 0; i < b.N; i++ {
		b.StopTimer()
		reader := bytes.NewReader([]byte(largePlain_Valid))
		b.StartTimer()
		iterator, err := newPlainSitemapPageIterator(reader)
		if err != nil {
			logAndFailNow(b, fmt.Sprintf("unexpected error from newPlainSitemapPageIterator: %s", err))
		}
		benchmark_SitemapPageIterator_Normal(b, iterator)
	}
}




func benchmark_SitemapPageIterator_Normal(b *testing.B, iterator SitemapPageIterator) {
	var success = iterator.Next()
	if !success {
		logAndFailNow(b, fmt.Sprintf("unexpected false from iterator.Next(): %s", iterator.Err()))
	}
	for success {
		if iterator.Item() == nil {
			logAndFailNow(b, fmt.Sprintf("unexpected nil from iterator.Item()"))
		}
		if iterator.Err() != nil {
			logAndFailNow(b, fmt.Sprintf("unexpected error from iterator.Next(): %s", iterator.Err()))
		}
		success = iterator.Next()
	}
	if iterator.Err() != nil {
		logAndFailNow(b, fmt.Sprintf("unexpected error from iterator.Next(): %s", iterator.Err()))
	}

	err := iterator.Reset()
	if err != nil {
		logAndFailNow(b, fmt.Sprintf("unexpected error from iterator.Reset(): %s", err))
	}
}

func logAndFailNow(b *testing.B, err_msg string) {
	b.Log(err_msg)
	b.FailNow()
}